import React from "react";
import { GameOverContainer, Button, Buttons } from "./GameOverElements";

const GameOver = ({ show, winner }) => {
    return (
        <GameOverContainer show={show}>
            <h2>Winner!</h2>
            <div>{winner}</div>
            <Buttons>
                <Button>Restart</Button>
                <Button>Swap Sides</Button>
                <Button>Exit</Button>
            </Buttons>
        </GameOverContainer>
    );
};

export default GameOver;
